import { Fragment, useEffect, useState, useContext } from "react";
import NewsCard from "./layout/NewsCard";
import Card from "./UI/Card";
import { HttpContext } from "../Http/GetData";
function Arts() {
  const context = useContext(HttpContext);
    context.getData('arts');
  return (
    <div>
      <Fragment>
        {context.data.map((e) => {
          return (
            <Card>
              <NewsCard
                title={e.title}
                desc={e.abstract}
                by={e.byline}
                imgUrl={e.multimedia[0].url}
              />
            </Card>
          );
        })}
      </Fragment>
    </div>
  );
}

export default Arts;
